import React from 'react';
// import { product } from '../../data';

function ProductTable(props) {
  const products = props.data.product.map(product => {
    return product;
  });
  const category = products.map(data => {
    return (
      <tr>
        <th colSpan="2">
          <th>{data.category}</th>
        </th>
      </tr>
    );
  });
  return(
    <table className="product-table">
      <thead>
        <tr>
          <th>Name</th>
          <th>Price</th>
        </tr>

      </thead>

    </table>
  )
}

export default ProductTable;
